syntax = "proto3";

package proto2_unittest;

import "google/protobuf/any.proto";

option java_outer_classname = "TestAnyProto";

message TestAny {
  int32 int32_value = 1;
  google.protobuf.Any any_value = 2;
  repeated google.protobuf.Any repeated_any_value = 3;
  string text = 4;
}
